import './App.css';

function App() {
  const people = [
    {
      name: 'James',
      age: 31,
    },
    {
      name: 'John',
      age: 45,
    },
    {
      name: 'Paul',
      age: 65,
    },
    {
      name: 'Ringo',
      age: 49,
    },
    {
      name: 'George',
      age: 34,
    }
  ];
  return  (
    <div>
      {people.filter(person => person.age < 60).map(filteredPerson => (
        <li>
        <strong>Name:</strong> {filteredPerson.name} <strong>Age:</strong> {filteredPerson.age}
        </li>
      ))}
    </div>
  );
}

export default App;
